        function modelCheck(stateCloseModal) {
            if(stateCloseModal == true){
                return <div className='test2'>{<BuchenPopup />}</div>
            }else if(stateCloseModal == false){
                return null
        }
    }
        return <div>{modelCheck(showModal)}</div>
     
           
}

